ortunities in this market.\n\nTime, a wellness smart watch, tracks a user’s activity, sleep and stress. It also connects to the Bellabeat app to provide insights into one’s daily wellness. With the assumption that one’s physical activity, sleep and stress levels are the only contributors to wellness, we will analyze smart device data on these three factors to gain insight into how consumers are using their smart watches to enhance their daily wellness. This will help guide Bellabeat’s marketing strategy.\n\n\n**2.0 Import Data**\n\nTo explore smart device user’s daily habits, we will analyze these datasets:\n\ni.\tFitBit Fitness Tracker Data, a Public Domain dataset on Kaggle made available through Mobius. The dataset from thirty fitbit users contains personal fitness tracker output on distance, steps, heart rate and, sleep duration.\n\nii.\tFitness Trends Dataset, a Public Domain dataset on Kaggle made available through Arooj Anwar Khan. The dataset contains a three month personal fitness tracker output on steps, mood, calories, and sleep duration.\n \nFor our study, we will use Kaggle Notebook with R packages. Let’s start by installing the needed packages:","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"scales\")\ninstall.packages(\"lubridate\") \ninstall.packages(\"here\")\ninstall.packages(\"skimr\")\ninstall.packages(\"janitor\")","metadata":{"execution":{"iopub.status.busy":"2022-01-02T08:11:56.536328Z","iopub.execute_input":"2022-01-02T08:11:56.538199Z","iopub.status.idle":"2022-01-02T08:13:20.879352Z"},"trusted":true},"execution_count":9,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n