ASaOwAAAAArAQaOwAAAAArgcYOAAAAwEr8H71OPGjg3LX7AAAA\nAElFTkSuQmCC"},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"In these two plots, it is evident that the higher the step count, the more the calories burnt. The more you move, the more calories you burn. According to the CDC, physical activity helps in weight management, reducing the symptoms of depression aand anxiety, and reducing the risk for type 2 diabetes, several forms of cancer and, osteoporosis among others. However, how much physical activity one needs to maintain a healthy lifestyle varies from person to person.","metadata":{}},{"cell_type":"markdown","source":"5.2. Sleep\n\n***Total Time Asleep vs Total Time In Bed***","metadata":{}},{"cell_type":"code","source":"ggplot(sleep)+geom_point(mapping=aes(x=TotalTimeInBed, y=TotalMinutesAsleep, color=Ymd))+\n  geom_smooth(mapping=aes(x=TotalTimeInBed, y=TotalMinutesAsleep))+\n  labs(title=\"Total Time Asleep vs Total Time in Bed\", subtitle=\"Sample of the Twenty Four Participants over Thirty One Days\")","metadata":{"execution":{"iopub.status.busy":"2022-01-02T08:21:15.290274Z","iopub.execute_input":"2022-01-02T08:21:15.29196Z","iopub.status.idle":"2022-01-02T08:21:15.643771Z"},"trusted":true},"execution_count":27,"outputs":[{"name":"stderr","text":"`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5wTxfsH8Gd2Uy71cr0fx9GOJr03qTaavSBYsFdUFGyIBfDn9ytYwF6/FrAX\nFEUEARGRLlKlHvV6yaWXnd8fgSOXu+RyNVzyef/Bi0wmu8/sTm6f7O7MMs45AQAAAEDLJ4Q6\nAAAAAABoHEjsAAAAAMIEEjsAAACAMIHEDgAAACBMILEDAAAACBNI7AAAAADCBBI7AAAAgDCB\nxA4AAAAgTIRDYrfxga4sCOP/LmyGYHb8Xx/G2MjvjjQ81C2PdmeMXbTmZDOEXSsumdurFYwx\nQVRsNjnrsYTAWyZsoDc2kcYKoOLYnOptFERlbGLWyMtu/2ZbUaNE67GgTQxjbFmprRGXCQAQ\nmCzUATSCqPjMtm3P/unkkvngoVOMydq0yfKulqIUg18ml8zr/9wuU2b2653RWHFS04TaPIr/\nmbnf6iQiLjkf+frIqintQh3