1-02T08:22:57.517174Z","iopub.status.idle":"2022-01-02T08:22:58.212722Z"},"trusted":true},"execution_count":32,"outputs":[{"name":"stderr","text":"`summarise()` has grouped output by 'Ymd'. You can override using the `.groups` argument.\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"Then, we will review the new table using the head() function","metadata":{}},{"cell_type":"code","source":"head(stress_levels)","metadata":{"execution":{"iopub.status.busy":"2022-01-02T08:23:21.133534Z","iopub.execute_input":"2022-01-02T08:23:21.135154Z","iopub.status.idle":"2022-01-02T08:23:21.164275Z"},"trusted":true},"execution_count":33,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 3</caption>\n<thead>\n\t<tr><th scope=col>Ymd</th><th scope=col>Id</th><th scope=col>mean_heartrate</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>2016-04-12</td><td>2022484408</td><td>75.80418</td></tr>\n\t<tr><td>2016-04-12</td><td>2347167796</td><td>86.08233</td></tr>\n\t<tr><td>2016-04-12</td><td>4020332650</td><td>83.49901</td></tr>\n\t<tr><td>2016-04-12</td><td>4558609924</td><td>76.63938</td></tr>\n\t<tr><td>2016-04-12</td><td>5553957443</td><td>64.36511</td></tr>\n\t<tr><td>2016-04-12</td><td>5577150313</td><td>65.65607</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA grouped_df: 6 × 3\n\n| Ymd &lt;chr&gt; | Id &lt;dbl&gt; | mean_heartrate &lt;dbl&gt; |\n|---|---|---|\n| 2016-04-12 | 2022484408 | 75.80418 |\n| 2016-04-12 | 2347167796 | 86.08233 |\n| 2016-04-12 | 4020332650 | 83.49901 |\n| 2016-04-12 | 4558609924 | 76.63938 |\n| 2016-04-12 | 5553957443 | 64.36511 |\n| 2016-04-12 | 5577150313 | 65.65607 |\n\n","text/latex":"A grouped\\_df: 6 × 3\n\\begin{tabular}{lll}\n Ymd & Id & mean\\_heartrate\\\\\n <chr> & <dbl> & <dbl>\\\\\n\\hline\n\t 2016-04-12 & 2022484408 & 75.80418\\\\\n\t 2016-04-12 & 2347167796 & 86.