ore distance one covers, the more calories one burns.\n\nIII.\tThe higher the step counts, the more calories one burns.\n\n\n**6.2. Sleep**\n\nI.\tThe longer one is in bed, the more time they get to sleep.\n\nII.\tThe more calories one loses, the longer they sleep.\n\n**6.3. Stress**\n\nI.\tThere participants with a heart rate of 60-90 have a higher step count than the ones with a heart rate of over 90.\n\nII.\tThe participants with a heart rate of 60-80 slept more than the ones with a heart rate of over 80.\n\n","metadata":{}},{"cell_type":"markdown","source":"**7.0. Conclusions and Recommendations**\n\nOur assumption was that one’s physical activity, sleep and stress levels are the only contributors to their wellness. From our analysis, this is true. During physical activity, indepedent of the type and intensity, the body uses up its energy or \"burns calories\". The more calories the participants burnt, the lower their heart rate was and, the longer they slept.  \n\nIn conclusion, Time, the Bellabeat wellness smart watch,which records one's physical activity, sleep and stress levels is ideal in monitoring one's daily wellness. These daily activities in turn contribute to one's overall health and well being.  \n\nFor Bellabeat's marketing strategy, we recommend:\n\nI.\tPromoting the value of physical activity over time because there is strong scientific evidence that this helps in weight management.\n\nII.\tIncluding a healthy eating plan because getting and maintaining healthy weight requires both physical activity and healthy eating.\n\nIII.\tPromoting good sleep habits such as exercising, and consistent sleeping time because they enhance one’s blood sugar control, heart health and metabolism. \n\nIV.\tPromote the value of stress management techniques such as regular exercising, relaxation and maintaining a positive attitude, all of which enhance one’s mental health, heart health and glucose control.\n\nV.\tMarket Time not only as a smart tracker, but also as a smart device that connects to the Bellabeat app to provide the users with their daily wellness and progress over time.\n\n\n\n\n\n","metadata":{}}]}